import React from "react";
import { Link } from "react-router-dom";

const MainNav = () => {
  return (
    <nav className="d-flex justify-content-evenly bg-dark text-white">
      <div>
        <img src="" alt="OY Technology Pvt. Ltd." />
      </div>
      <div className="">
        <Link className="p-2 mx-2 text-white">Home</Link>
        <Link className="p-2 mx-2 text-white">About Us</Link>
        <Link className="p-2 mx-2 text-white">Services</Link>
        <Link className="p-2 mx-2 text-white">Pages</Link>
        <Link className="p-2 mx-2 text-white">Career</Link>
        <Link className="p-2 mx-2 text-white">Blogs</Link>
      </div>
    </nav>
  );
};

export default MainNav;
